import React from "react";
import TableRow from "./TableBody/TableRow";

const Table = ({ matrix }) => {
   const rows = matrix.map((row, index) => {
      return <TableRow key={index} data={row}/>
   });
   return (
      <table>
         <tbody>{rows}</tbody>
      </table>
   );
};

export default Table;
